def zmnozi_sez(sez):
    stevilo = 1
    for x in sez:
        stevilo *= x
    return stevilo

def zmozi_str(n):
    stevilka = 1
    for x in range(len(n)):
        stevilka *= int(n[x])
    return stevilka


def najvecji_zmnozek_n_zaporedih_stevk_v_stevilu(n,stevilo):
    najvecje = 0
    st = str(stevilo)
    st_ponovitev = len(st) - n 
    for x in range(st_ponovitev):
        stevilka = st[x : x+n]

        if zmozi_str(stevilka) > najvecje:
            najvecje = zmozi_str(stevilka)
        else: 
            pass
    return najvecje

najvecji_zmnozek_n_zaporedih_stevk_v_stevilu(13,)

najvecji_zmnozek_n_zaporedih_stevk_v_stevilu(13,"""""")
